import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { useState } from 'react';


function App() {

  return (
    <Routes>
      <Route path="/" element={<Home />}></Route>
      <Route path="/list" element={<ListView />}></Route>
    </Routes>
  );
}


export default App;
